create database project_equilibrio;
use project_equilibrio;


CREATE TABLE `diagnosticos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nome` varchar(255) NOT NULL,
  `genero` enum('Masculino','Feminino') DEFAULT NULL,
  `idade` int(11) DEFAULT NULL CHECK (`idade` >= 16 and `idade` <= 100),
  `pressao_academica` int(11) DEFAULT NULL CHECK (`pressao_academica` >= 0 and `pressao_academica` <= 5),
  `rendimento_academico` int(11) DEFAULT NULL CHECK (`rendimento_academico` >= 0 and `rendimento_academico` <= 10),
  `satisfacao_estudo` int(11) DEFAULT NULL CHECK (`satisfacao_estudo` >= 0 and `satisfacao_estudo` <= 5),
  `duracao_sono` int(11) DEFAULT NULL CHECK (`duracao_sono` >= 1 and `duracao_sono` <= 24),
  `habitos_alimentares` enum('Pouco','Moderado','Muito') DEFAULT NULL,
  `graduacao` enum('Bacharel em Administração de Empresas','Bacharel em Aplicações de Computador','Bacharel em Arquitetura','Bacharel em Artes','Bacharel em Ciências','Bacharel em Comércio','Bacharel em Direito','Bacharel em Educação','Bacharel em Engenharia','Bacharel em Farmácia','Bacharel em Gestão Hoteleira','Bacharel em Medicina, Bacharel em Cirurgia','Bacharel em Tecnologia','Doutor em Filosofia','Doutor em Medicina','Ensino Médio Completo','Mestre em Administração de Empresas','Mestre em Aplicações de Computadores','Mestre em Artes','Mestre em Ciências','Mestre em Comércio','Mestre em Direito','Mestre em Educação','Mestre em Engenharia','Mestre em Farmácia','Mestre em Gestão da Saúde','Mestre em Tecnologia','Outro') DEFAULT NULL,
  `pensamento_suicida` enum('Não','Sim') DEFAULT NULL,
  `horas_estudando` int(11) DEFAULT NULL CHECK (`horas_estudando` >= 0 and `horas_estudando` <= 24),
  `pressao_financeira` int(11) DEFAULT NULL CHECK (`pressao_financeira` >= 0 and `pressao_financeira` <= 10),
  `historico_familiar` enum('Não','Sim') DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `diagnostico_previsto` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



CREATE TABLE `dados` (
  `id` int(11) NOT NULL,
  `genero` text DEFAULT NULL,
  `idade` int(11) DEFAULT NULL,
  `pressao_academica` int(11) DEFAULT NULL,
  `IRA` double DEFAULT NULL,
  `satisfacao_estudo` int(11) DEFAULT NULL,
  `horas_de_sono` text DEFAULT NULL,
  `habitos_alimentares` text DEFAULT NULL,
  `graduacao` text DEFAULT NULL,
  `pensamentos_suis` text DEFAULT NULL,
  `carga_horaria` int(11) DEFAULT NULL,
  `estresse_finaneiro` int(11) DEFAULT NULL,
  `historico_familiar` text DEFAULT NULL,
  `depressao` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


